script: |
  super -f text -I q11699.spq | sort > q11699.out

inputs:
  - name: q11699.spq
    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE - col2 + ( + col0 ) - + + col0 NOT IN ( - 37 - col2 * + col1 / col0 );
  - name: tab1

outputs:
  - name: q11699.out
    data: |
      51	14	96
      85	5	59
      91	47	68
